import React , { Component } from 'react';
import axios from 'axios';
import {API_BASE_URL } from '../../constants/apiConstants';
import { withRouter,Switch, Route, Link } from "react-router-dom";
//import {Route, IndexRoute,browserHistory} from 'react-router';
import { Router,browserHistory } from 'react-router';

class AddEmployee extends Component {

    constructor(props) {
        super(props);
        this.state = {
          employee_name: null,
          employee_salary: null,
          employee_age: null,
          mobile_number: null,
          address: null,
          errors: {
            employee_name: '',
            employee_salary: '',
            employee_age: '',
            mobile_number: '',
            address: '',  
          }
        };
      }

      componentDidMount() {

      } 

    render() { const { history } = this.props;   
        return <div class="container">
                   <div class="row">
                     <form>
                        <div class="form-row">
                            <div class="form-group col-md-6">
                            <label for="inputEmail4">Employee Name</label>
                            <input type="text" name="employee_name" class="form-control" id="input4Email4" placeholder="Employee Name"/>
                            </div>
                            <div class="form-group col-md-6">
                            <label for="inputPassword4">Employee Salary</label>
                            <input type="text" name="employee_salary" class="form-control" id="input4Password4" placeholder="Employee Salary"/>
                            </div>
                        </div>
                        <div class="form-row">
                            <div class="form-group col-md-6">
                            <label for="inputEmail4">Employee Age</label>
                            <input type="text" name="employee_age" class="form-control" id="inputEmail44" placeholder="Employee Age"/>
                            </div>
                            <div class="form-group col-md-6">
                            <label for="inputPassword4">Employee Mobule No</label>
                            <input type="text" name="mobile_number" class="form-control" id="inputPasswo4rd4" placeholder="Employee Mobule No"/>
                            </div>
                        </div>
                        <div class="form-group">
                            <label for="inputAddress">Address</label>
                            <input type="text" name="address" class="form-control" id="inputAddress" placeholder="1234 Main St"/>
                        </div>
                        <div class="form-group">
                            <div class="form-check">
                            <input class="form-check-input" type="checkbox" id="gridCheck"/>
                            <label class="form-check-label" for="gridCheck">
                                Check me out
                            </label>
                            </div>
                        </div>
                        <button type="submit" class="btn btn-primary">Sign in</button>
                     </form>                     
                   </div>
                </div>;
    }
}
export default withRouter(AddEmployee);
